  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109916 includes chemical,
  discrete sample, physical and profile data collected from MARIA S. MERIAN in the
  Davis Strait, Labrador Sea and North Atlantic Ocean from 2009-07-14 to 2009-08-22
  and retrieved during cruise 06M220090714 and MSM12_3. These data include ALKALINITY,
  AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
  to collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Toste Tanhua, M. Rhein, Tobias Steinhoff
  and Arne Kortzinger of Leibniz Institut Fur Meereswissenschaften as part of the
  CLIVAR_AR07W_2009_06M220090714 data set.nnThe International CLIVAR Global Ocean
  Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
